/* a structure to store all information we need  for our thread */
typedef struct kthread_struct
{
        /* private data */
        struct task_struct *thread; /* Linux task structure of thread */
        struct tq_struct tq; /* Task queue need to launch thread */
        void (*function) (struct kthread_struct *kthread); /* function to be started as thread */
        struct semaphore startstop_sem; /* semaphore needed on start and creation of thread. */

        /* public data */
        wait_queue_head_t queue; /* queue thread is waiting on. Gets initialized by init_kthread, can be used by thread itself.*/
        int terminate; /* flag to tell thread whether to die or not. When set the thread will call exit_kthread and terminate */
        void *arg; /* additional data to pass to kernel thread */
} kthread_t;

